INSERT INTO `manga` (`id`, `name_manga`, `anothor_name`, `description`, `alias`, `image`, `author`, `view`, `category`, `team_translate`, `release_date`, `favorite`, `status`) VALUES
(1, 'Tu tiên giả đại chiến siêu năng lực', 'Tu tiên giả đại chiến siêu năng lực', '', 'tu-tien-gia-dai-chien-sieu-nang-luc', 'images/tu-tien-gia-dai-chien-sieu-nang-luc.jpg', 'Manhua', 1, 'Tu tiên', 'Phúc Híp', 'Thứ 6', 155, 1),
(2, 'Tôi đã chuyển sinh thành Slime', 'Dạo quanh lãnh địa Demon', 'Một manga khác chuyển thể từ light novel đang hot ở nhật. Một anh chàng bị tên cướp đâm chết khi đang gặp vợ chưa cưới của đồng nghiệp. Khi đang thoi thóp trước khi chết, người đầy máu, anh ta nghe được một tiếng nói kỳ lạ. Giọng nói ấy chuyển thể sự tiếc nuối của anh chàng vì vẫn còn tân trước khi đi và ban cho anh ta chiêu thức đặc biệt [tiên nhân vĩ đại]. Liệu đây có phải là trò đùa?', 'toi-da-chuyen-sinh-thanh-slime', 'images/toi-da-chuyen-sinh-thanh-slime.jpg', 'Manga', 14, 'Chuyển sinh', 'Phúc Híp', 'Thứ 3', 265, 1),
(3, 'Solo Leveling', '', '', 'toi-thang-cap-mot-minh', 'images/toi-thang-cap-mot-minh.jpg', 'Phúc Híp', 0, 'Manhua', 'Chu Huyền', 'Thứ 5', 16645, 0),
(4, 'Anh hùng mạnh nhất trở lại', 'Anh hùng mạnh nhất trở lại', '', 'anh-hung-manh-nhat-tro-lai', 'images/anh-hung-manh-nhat-tro-lai.jpg', '', 0, 'Manga', 'Phúc Híp', 'Thứ 4', 11478, 1),
(5, 'Anh hùng mạnh nhất ! Ta không làm lâu rồi', 'Kẻ sống sót vua kiếm', 'Một thanh niên vô tình bị du hành tới một thế giới ảo, nơi anh được hỗ trợ bởi một hệ thống siêu đẳng. Anh trở thành “người được chọn”, chỉ có điều hệ thống đó… lỗi lòi mắt. Anh ta sẽ phải chiến đấu r', 'anh-hung-manh-nhat-ta-khong-lam-lau-roi', 'images/anh-hung-manh-nhat-ta-khong-lam-lau-roi.jpg', 'Phúc', 0, 'Manhua', 'Phúc Híp', 'Thứ 7', 5689, 1),
(6, 'Sự trở lại của pháp sư vĩ đại sau 4000 năm', 'Pháp sư vĩ đại trở lại sau 4000 năm', 'Đại phù thủy Lucas Traumen - người mạnh nhất thế giới. Trong một lần đi tiêu diệt quái vật đã khiến thần nổi giận và phạm tội khinh thường Chúa, anh ta bị phong ấn trong địa ngục suốt 4000 năm. Đến khi tỉnh lại thì anh ta đã nhập vào thân xác của Frey Blake - thanh niên yếu nhất thế giới vừa tự sát, và bắt đầu hành trình khôi phục lại sức mạnh để diệt thần.', 'su-tro-lai-cua-phap-su-vi-dai-sau-4000-nam', 'images/su-tro-lai-cua-phap-su-vi-dai-sau-4000-nam.jpg', 'Huyền', 1, 'Manhua', 'Phúc Híp', 'Thứ 6', 78954, 1),
(7, 'Tiên kiếm bất bại', 'Tiên kiếm bất bại', '', 'tien-kiem-bat-bai', 'images/tien-kiem-bat-bai.jpg', '', 0, '', '', '', 0, 1),
(9, 'Bạn học của tôi là lính đánh thuê', 'Bạn học tôi là lính đánh thuê', 'Yu Ijin - người duy nhất sống sót sau một vụ tai nạn máy bay thảm khốc khi anh còn nhỏ. Sau quãng thời gian 10 năm trở thành lính đánh thuê để hoàn thành giao kèo với người đã cứu mình, cậu đã trở về ', 'ban-hoc-cua-toi-la-linh-danh-thue', 'images/ban-hoc-cua-toi-la-linh-danh-thue.jpg', '', 1, 'Hành động', 'Mega Team', 'Thứ 3', 1457, 1),
(10, 'Ánh sáng nơi cuối con đường', 'The Beginning After The End', 'King Grey là người sở hữu tất cả trong một thế giới bị Võ thuật chi phối. Nhưng đi đôi với một sức mạnh to lớn lại là sự cô độc không hồi kết. Thế nên, mặc dù vẻ bên ngoài là một quốc vương mạnh mẽ, n', 'anh-sang-cuoi-con-duong', 'images/the-beginning-after-the-end.webp', 'TurtleMe', 1, 'Hành dộng', '', 'Thứ 6', 1450, 1);
